    const content = <section class = "content">
        <div>
            <div class = "columns">
                <div class = "column">
                    </div>
                <div class = "column is-three-quarters">
                {c}
                </div>
                <div class = "column">
                    </div>
            </div>
        </div>
    </section>

    return(content)
}


export default Content;
